import React from "react";
import { items } from "../data";
import Product from "./Product";

const Products = () => {
  return (
    <div className="container d-flex">
      <hr />

      {items.map(item => {
        const { id } = item;
        return <Product key={id} item={item} />;
      })}
    </div>
  );
};

export default Products;
